import { NavLink } from "react-router-dom";
// import class_navbar from "./Navbar.module.css";
// import class_navbar from "./Navbar.module.css";
import "./Navbar.css";
// import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className="nav">
      <div className="item">
        <NavLink to="/dialogs" activeClassName="activeLink">
          Messages
        </NavLink>
      </div>
      <div className="item">
        <NavLink to="/profile" activeClassName="activeLink">
          Profile
        </NavLink>
      </div>
      <div className="item">
        <NavLink to="/news" activeClassName="activeLink">
          News
        </NavLink>
      </div>
      <div className="item">
        <NavLink to="/music" activeClassName="activeLink">
          Music
        </NavLink>
      </div>
      <div className="item">
        <NavLink to="/settings" activeClassName="activeLink">
          Settings
        </NavLink>
      </div>
    </nav>
  );
};

export default Navbar;
